import "./header.css"

export default function Header() {
    return (
    <div className="header">
        <div className="headerTitles">
            <span className="headerTitleSm">React & Node</span>
            <span className="headerTitleLg">Blog</span>
        </div>
        <img src="https://zoomviewer.toolforge.org/iipsrv.fcgi?FIF=cache/ecf445f5de521cf97b4271527749ecc3.tif&cnt=1&sds=0,90&jtl=3,26" alt="" className="headerImg" />

    </div>
    )
}
